-- ----------------------------
-- Triggers for table PDL_BRAND_REPAIR_OUTLETS
-- 设置id自增长
-- ----------------------------
create sequence PBRO_tb_seq minvalue 1 maxvalue 99999999
increment by 1
start with 1;

create trigger PBRO_tb_tri
before insert on PDL_BRAND_REPAIR_OUTLETS
for each row
begin
select  PBRO_tb_seq.nextval into :new.ID from dual;
end;
